@I_am_ahonandesu ファミペイはそんなにお得じゃないけど
レシートの○円引きクーポンと商品に貼ってある○円引きは同時に使えるからパンとかおにぎりが1個¥80〜90くらいになるのは超お得だと思う
レシートをもらえ！

@kouk07ko 結局、ファミペイでやるということで、時間関係なく出来る感じでしたー。
2枚プリントして、1枚が娘の推し出たのでラッキーでしたよー✌✨
男闘呼組も、こういうのやらないかな−？あ、ロックオンで！！

@yuyatentyo ファミペイお試しクーポンって復活してたんや！
お試しクーポンの為に千円入金して放置してたけど、これでやっとファミペイ残高の使い道が出来た
教えてくれてありがとうございました

@tomatoysk815 いま、結構ファミペイ、pay pay後払いは厳しいみたいですね。
自分はファミペイでたての時だったので、通りましたが、pay pay後払いは落ちました。

他はやられましたか？

